import React from "react";
import { NavLink } from "react-router-dom";

const Notes = () => {

return(
    <>
    
    
    <div className="container">
        <h1><NavLink to="/study" ><h2 className="btn btn-primary">Upload</h2></NavLink></h1>
      <div className="bg-danger text- p-3 text-white text-center"><h1>Uploaded Files</h1> </div>
      {/* <NavLink to="/study" ><h2 className="btn btn-primary">Upload</h2></NavLink> */}
      
        <div className="row">
                
        <h1 id="notes">Subject Notes</h1>
          
          </div>
        </div>
      
    
    </>
);
};
export default Notes;
